import logo from './logo.svg';
import './App.css';
import React,{ Component, useState, useEffect } from 'react';
import axios from 'axios';
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";

class App extends Component{


selecetedFile = event=>{
this.setState({
selecetedFile: event.target.files[0]
})
}

dosyaUpload= () =>{
const fd = new FormData();
fd.append('image',this.state.selecetedFile,this.state.selecetedFile.name);
axios.post("/upload",fd);

}


render(){ return(<div className="App">)
    <div>
<Router><Switch><Route path="/sn" exact></Route> </Switch></Router>
    </div>
<input type="file" onChange={this.selecetedFile}/>
<button onClick={this.dosyaUpload}>Upload</button>

</div>);


}





}
export default App;
